export default {
  title: 'Network Discovery schema',
  type: 'object',
  properties: {
    enabled: { type: 'boolean' },
    plugins: {
      type: 'array',
      minContains: 3,
      maxContains: 3,
      items: {
        type: 'object',
        properties: {
          autoInterval: { type: 'number' },
          enabled: { type: 'boolean' },
          type: {
            enum: ['lldp', 'nmap', 'neighbour'],
          },
        },
        required: ['autoInterval', 'enabled'],
        additionalProperties: false,
      },
    },
  },
  required: ['enabled', 'plugins'],
  additionalProperties: false,
}
